import axios from 'axios';


export default class Devis extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [],
        }
    }

    componentDidMount() {
var array = [];
        axios.get(`https://sayse.pipedrive.com/v1/deals?api_token=d168467b213a71acdc4ba5cb5b2cfe96529ac061`)
        .then(res => {
            // console.log(res.data.data)
            res.data.data.forEach(element => {
                this.setState({data: element.value})
                array.push(element.value)
                console.log(array)

            });
        })
    }

